import React,{Component} from "react"

class AddPhoto extends Component{
    render(){
        return <div>
         <h1>Photowall</h1>
         <form className="form">
             <input type="text" placeholder="Enter Url" />
             <input type="text" placeholder="Enter Caption" />
         </form>
         </div>
    };
}

export default  AddPhoto
